const Rating = ({value,text}) => {

      return(
        <div className ="rating">
            <span>
             <i className={value >= 1 ? 'fas fa-star' : value >= 0.5 ? 'fas fa-star-half-alt' : 'far fas-star'}></i>
            </span>
        </div>
      )
}


export default Rating
